    s:"Enter a movie...",
    results:[],
    selected:{}
  });
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Let's build a movie app</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000000',
